const Nav = ({topics})=>{
   const topicList = topics.map((topic)=>{
    <li>
        <a href="/read/">{topic.title}</a>
    </li>
   })

   return(
    <ul>
        {topicList}
    </ul>
   );   
}

export default Nav;
